#include <iostream>
using namespace std;

static int c;

void print(int *arr, int n)
{
    for (int i = 0; i < n; i++)
    {
        cout << arr[i] << "\t";
    }
    cout << endl;
}

void swap(int &a, int &b)
{
    int c = a;
    a = b;
    b = c;
}

int partition(int *arr, int i, int j)
{
    int key = arr[i];
    int s = i;
    int e = j;
    c++;
    while (i < j)
    {
        do
        {
            i++;
            c++;
        } while (i <= e && arr[i] < key); // either use INT_MAX as end element to stop it if no bigger element found or use i<=e

        do
        {
            j--;
            c++;
        } while (j >= s && arr[j] > key);

        if (i < j)
        {
            c++;
            swap(arr[i], arr[j]);
        }
    }

    swap(arr[j], arr[s]);
    // print(arr, n);
    return j;
}

void QuickSort(int *arr, int low, int high)
{
    if (low < high)
    {
        c++;
        int p = partition(arr, low, high+1); // size = high + 1
        QuickSort(arr, low, p-1);
        QuickSort(arr, p + 1, high);
    }
}

